5694244	8609694	Faridul Hasan Shuvo				course.xml	m		1999	jhs	I am about to cross 16. I wake up early in the morning everyday, most of the days i forget to brush my teeth on time. Then do my high-school math homework before i go to my classes. It takes almost one hour to go to school by bus. Sometimes i get to sit sometimes not but that really doesn't resist me thinking in the mean time. Yeah Thinking. The best part of my day is thinking. About what? Well, everything. If a guy near me is sitting quiet, "why is he quiet?" or " If on summer weather am standing on bus heading towards school, "what can be done to ease the summer pain, the temperature?". Sometimes overwhelmed with curiosity or sometimes desperate of finding a solution.	1	BD		I am about to cross 16. I wake up early in the morning everyday, most of the days i forget to brush my teeth on time. Then do my high-school math homework before i go to my classes. It takes almost one hour to go to school by bus. Sometimes i get to sit sometimes not but that really doesn't resist me thinking in the mean time. Yeah Thinking. The best part of my day is thinking. About what? Well, everything. If a guy near me is sitting quiet, "why is he quiet?" or " If on summer weather am standing on bus heading towards school, "what can be done to ease the summer pain, the temperature?". Sometimes overwhelmed with curiosity or sometimes desperate of finding a solution.\n\n \n\nSo, if i calculate the times i have literally nothing to do, it make around 3-4 hours per day. Man i am 16 and i don't go parties neither do i belong to the Gates families. So what else would i have left except for thinking?  And when i continuously keep thinking about stuffs around me, I feel like a mad Scientists with a bagful of works to do for tomorrow. I run around people with my ideas and i get to know that they suck! There not the end. you? you 16 old kiddo plan to work on a research? Have you got screwed?Have you lost your mind? Life is not all that easy to survive as you think. Man, i am planning to do something which makes life easier :( Okay, now That's disappointing. Discouraging instead. \n\nI have got a question to the world today?\n\nWhat is the age of learning?\n\nIf i don't learn now then when would i go implement my ideas? Ideas comes in seconds but working on it takes time man. And if i have to learn the same thing again after a few years when i turn 21 with no interest, what's the use?	NULL
